import {selectuser,followers} from "./Types";

debugger;
export const selectUser = (payload) => {
    console.log(selectuser)
    debugger;
    return {
        type:selectuser,
        payload:{
            userDetail:payload
        }
    }
}
export const userFollower = (payload) => {
    console.log(selectuser)
    debugger;
    return {
        type:followers,
        payload:{
            follower:payload
        }
    }
}
